import React, { useState } from 'react';

interface NavbarProps {
  isScrolled: boolean;
}

const Navbar: React.FC<NavbarProps> = ({ isScrolled }) => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const scrollToSection = (sectionId: string) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
    setIsMobileMenuOpen(false);
  };

  const navItems = [
    { name: 'Home', id: 'hero' },
    { name: 'Courses', id: 'courses' },
    { name: 'Career Prep', id: 'career-addons' },
    { name: 'Pricing', id: 'pricing' },
    { name: 'Testimonials', id: 'testimonials' },
    { name: 'About', id: 'about' },
    { name: 'Trainers', id: 'trainers' },
    { name: 'Contact Us', id: 'contact' }
  ];

  return (
    <nav className={`fixed top-0 left-0 right-0 z-50 transition-all duration-500 ${
      isScrolled 
        ? 'bg-gradient-to-r from-grafanaGray/95 via-grafanaBg/95 to-grafanaGray/95 backdrop-blur-xl shadow-2xl border-b border-grafanaBlue/30' 
        : 'bg-gradient-to-r from-grafanaBg/80 via-grafanaGray/80 to-grafanaBg/80 backdrop-blur-lg'
    }`}>
      <div className="container mx-auto px-6">
        <div className="flex items-center justify-between h-20 md:h-24">
          {/* Logo */}
          <div className="flex items-center group">
            <div className="relative">
              {/* Cloud shape background */}
              <svg className="w-48 h-16 md:w-56 md:h-20" viewBox="0 0 200 60" fill="none">
                <path 
                  d="M20 30 Q20 15 35 15 Q50 15 60 25 Q70 15 85 15 Q100 15 110 25 Q120 15 135 15 Q150 15 160 25 Q170 15 185 15 Q200 15 200 30 Q200 45 185 45 Q170 45 160 35 Q150 45 135 45 Q120 45 110 35 Q100 45 85 45 Q70 45 60 35 Q50 45 35 45 Q20 45 20 30 Z" 
                  className="fill-gradient-to-r from-grafanaBlue/20 to-grafanaGreen/20 group-hover:from-grafanaGreen/20 group-hover:to-grafanaBlue/20 transition-all duration-300"
                  stroke="url(#cloudBorder)"
                  strokeWidth="1"
                />
                <defs>
                  <linearGradient id="cloudBorder" x1="0%" y1="0%" x2="100%" y2="0%">
                    <stop offset="0%" stopColor="#3B82F6" stopOpacity="0.3" />
                    <stop offset="100%" stopColor="#10B981" stopOpacity="0.3" />
                  </linearGradient>
                </defs>
              </svg>

              {/* Text overlay */}
              <div className="absolute inset-0 flex items-center justify-center">
                <span className="text-lg md:text-xl font-display font-bold bg-gradient-to-r from-white via-grafanaBlue to-white bg-clip-text text-transparent group-hover:from-grafanaBlue group-hover:to-grafanaGreen transition-all duration-300 drop-shadow-sm">
                  Cloud Blogger
                </span>
              </div>
            </div>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-1">
            {navItems.map((item) => (
              <button
                key={item.id}
                onClick={() => scrollToSection(item.id)}
                className="relative text-gray-300 hover:text-white transition-all duration-300 font-medium text-sm px-4 py-2 rounded-lg group overflow-hidden"
              >
                <span className="relative z-10">{item.name}</span>
                <div className="absolute inset-0 bg-gradient-to-r from-grafanaBlue/10 to-grafanaGreen/10 rounded-lg opacity-0 group-hover:opacity-100 transition-all duration-300"></div>
                <div className="absolute bottom-0 left-0 w-0 h-0.5 bg-gradient-to-r from-grafanaBlue to-grafanaGreen group-hover:w-full transition-all duration-300"></div>
              </button>
            ))}
          </div>

          {/* CTA Button */}
          <div className="hidden md:block">
            <button
              onClick={() => scrollToSection('contact')}
              className="relative bg-gradient-to-r from-grafanaBlue to-grafanaGreen text-white px-8 py-3 rounded-full font-medium shadow-lg hover:shadow-grafana hover:shadow-xl transition-all duration-300 text-sm group overflow-hidden"
            >
              <span className="relative z-10">Book Free Demo</span>
              <div className="absolute inset-0 bg-gradient-to-r from-grafanaGreen to-grafanaBlue opacity-0 group-hover:opacity-100 transition-all duration-300 rounded-full"></div>
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button
            onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
            className="md:hidden text-white p-2 hover:bg-grafanaBlue/20 rounded-lg transition-all duration-300"
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              {isMobileMenuOpen ? (
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
              ) : (
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
              )}
            </svg>
          </button>
        </div>

        {/* Mobile Menu */}
        {isMobileMenuOpen && (
          <div className="md:hidden bg-gradient-to-b from-grafanaGray/95 to-grafanaBg/95 backdrop-blur-xl border-t border-grafanaBlue/30 animate-in slide-in-from-top-2 duration-300">
            <div className="px-6 py-6 space-y-2">
              {navItems.map((item) => (
                <button
                  key={item.id}
                  onClick={() => scrollToSection(item.id)}
                  className="block w-full text-left text-gray-300 hover:text-white transition-all duration-300 font-medium py-3 px-4 rounded-lg hover:bg-grafanaBlue/10"
                >
                  {item.name}
                </button>
              ))}
              <button
                onClick={() => scrollToSection('contact')}
                className="w-full bg-gradient-to-r from-grafanaBlue to-grafanaGreen text-white px-8 py-4 rounded-full font-medium shadow-lg hover:shadow-grafana transition-all duration-300 text-sm mt-4"
              >
                Book Free Demo
              </button>
            </div>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
